            min = "1"
            max = "12"
          />

          <input
            type="number"
            name="number"
            placeholder="Expiry Year"
            min = "2021"
            max ="2040"

          />

          <input
            type="tel"
            name="number"
            placeholder="cvv"

          />
 </div>
    </div>
  );
}

export default App;
